import React from 'react';
import styled from 'styled-components';

function CareerConnectionBanner() {
	return (
		<ComponentWrapper>
			<button
				type="button"
				className="CareerConnectBanner_CareerConnectBanner__content__L_tab"
				data-attribute-id="profile__scrapCareer__banner__click"
			>
				<div className="CareerConnectBanner_content__spNoi">
					<div>
						<p className="CareerConnectBanner_mainTitle__obanG">
							입사일 퇴사일 헷갈릴 때, 내 경력 한눈에 모아보기!
						</p>
						<p className="CareerConnectBanner_moTitle__RnVAq">
							입사일 퇴사일 헷갈린다면?
						</p>
					</div>
					<strong className="CareerConnectBanner_commonBtn__qQ9jT">
						지금 확인하기
					</strong>
					<strong className="CareerConnectBanner_profileMobileBtn__KNTI2">
						내 경력 한눈에 모아보기
						<span>
							<span className="SvgIcon_SvgIcon__root__8vwon">
								<svg
									className="SvgIcon_SvgIcon__root__svg__DKYBi"
									viewBox="0 0 18 18"
								>
									<path d="m11.955 9-5.978 5.977a.563.563 0 0 0 .796.796l6.375-6.375a.563.563 0 0 0 0-.796L6.773 2.227a.562.562 0 1 0-.796.796L11.955 9z" />
								</svg>
							</span>
						</span>
					</strong>
					<picture>
						<source
							srcSet="https://static.wanted.co.kr/career_connect/banner.webp"
							type="image/webp"
						/>
						<img
							src="https://static.wanted.co.kr/career_connect/banner.png"
							alt="career-connect-banner"
						/>
					</picture>
				</div>
				<div className="CareerConnectBanner_content__mobile__qqn5o">
					<div>
						<p className="CareerConnectBanner_mainTitle__obanG">
							입사일 퇴사일 헷갈린다면?
						</p>
						<p className="CareerConnectBanner_subTitle__XlY91" />
						<strong>지금 확인하기</strong>
					</div>
					<picture>
						<source
							srcSet="https://static.wanted.co.kr/career_connect/banner-mobile.webp"
							type="image/webp"
						/>
						<img
							src="https://static.wanted.co.kr/career_connect/banner-mobile.png"
							alt="career-connect-banner"
						/>
					</picture>
				</div>
			</button>
		</ComponentWrapper>
	);
}

const ComponentWrapper = styled.aside`
	width: 100%;
	height: 105px;
	border-radius: 3px;
	margin-bottom: 20px;
	background: linear-gradient(90deg, #ddebff -0.28%, #b7d8ff);
	cursor: pointer;
	.CareerConnectBanner_CareerConnectBanner__content__L_tab {
		position: relative;
		display: flex;
		align-items: center;
		width: 100%;
		height: 100%;
		padding: 0 24px;
		font-size: 16px;
		font-weight: 700;
		line-height: 19px;
		color: #5071dc;
		.CareerConnectBanner_content__spNoi {
			z-index: 0;
			display: -ms-flexbox;
			display: flex;
			-ms-flex-direction: column;
			flex-direction: column;
		}
	}
`;

export default CareerConnectionBanner;
